def PatternMatch(Pattern,Genome):
    match = []
    for i in range(0,len(Genome)-len(Pattern)+1):
        if Genome[i:i+len(Pattern)] == Pattern:
            match.append(i)
    return ' '.join(map(str,match))

print(PatternMatch("TATTGTTTA",""))